import { TestService } from '../test.service';


@Component({
  selector: 'app-square',
  template: `<div> 
              <button (click)="send()">Send</button>          

              </div>
  `,
  styleUrls: ['square.component.css']
})
export class SquareComponent {
  //<div class="square" *ngFor="let square of squares"></div>
  // You can use properties and methods here to keep track of the state of the square
  private hg = {
    method: 'create',
    clientId: 30,
  };
   constructor(private wsService: TestService) {
    this.wsService.receive().subscribe(message => {
      console.log(message.clientId);
      if(this.hg.clientId=message.clientId;
    });
  }


  send() {
    this.wsService.send(this.hg);
  }
}
